window.bookSummaryJSON = "<p>Hailed for its “masterful storytelling” by Fandom, the groundbreaking Audible Original series continues.</p> <p>The stakes couldn’t be higher. Darcy, who once seemed to be our only hope for surviving the vampire apocalypse, has gone to the dark side—she’s now the reigning vampire queen. Meanwhile, her sister Hope must lead the charge to save humanity—on a path that’s taking her straight to Darcy.</p> <p>Will an emboldened Hope destroy her own sister to save the world? Would a godlike Darcy ever allow that to happen? They say hope is a dangerous thing, and they just might be right.</p> <p><b>Please note: This content is for mature audiences only. It contains adult language and themes. Discretion is advised.</b></p> <p>Available in Dolby Atmos on Audible.</p>"; 
